-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `pro_v_inventario`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `pro_v_inventario` AS select `d`.`cod_producto` AS `cod_product`,`d`.`cod_producto` AS `cod`,`d`.`cod_alterno` AS `cod_alt`,`d`.`nom_producto` AS `nom_product`,ifnull((select ((select sum(`dc`.`cant`) from `pro_3dcompra` `dc` where (`dc`.`cod_producto` = `d`.`cod_producto`)) - ifnull((select sum(`dv`.`cant`) from `pro_3dventa` `dv` where (`dv`.`cod_producto` = `d`.`cod_producto`)),0))),0) AS `stock`,`d`.`p_costo` AS `pcosto`,`d`.`p_venta` AS `pventa`,concat(round((((((`d`.`p_venta` - `d`.`p_costo`) / 100) * 100) / `d`.`p_costo`) * 100),2),'%') AS `ub`,`d`.`descripcion` AS `desc_product`,`c`.`id_categoria` AS `optgrupo`,`c`.`nom_categoria` AS `categoria`,`d`.`stock_minimo` AS `stockminimo`,`d`.`stock_maximo` AS `stockmaximo`,`d`.`u_medida` AS `umedida`,`d`.`excento` AS `excento` from (`pro_2producto` `d` join `pro_1categoria` `c` on((`d`.`cod_categoria` = `c`.`id_categoria`))) where (`d`.`activo` = 1) order by `d`.`nom_producto`
;

-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `v_usuario`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `v_usuario` AS select `u`.`nom_usuario` AS `nom_usuario`,`u`.`nivel` AS `nivel`,`u`.`log_user` AS `log_user`,`u`.`psw` AS `psw`,`u`.`activo` AS `activo`,`e`.`rif_empresa` AS `rif`,`e`.`nom_empresa` AS `nom_empresa`,`e`.`tel_empresa` AS `telf`,`e`.`email_empresa` AS `email`,`e`.`direccion_empresa` AS `direccion`,`e`.`vendedor` AS `vendedor`,`e`.`percomision` AS `percomision` from (`pro_2usuario` `u` join `pro_2empresa` `e` on((`u`.`empresa` = `e`.`rif_empresa`)))
;

